    const posts=createSelectorHook((state)=>state.posts)
    const classes=useStyles();
    console.log(posts)
    return(
        !posts ?<CircularProgress/>:(
            <Grid className={classes.container}container alignItems='stretch' spacing={3}>
                {posts.map((p))}
            </Grid>
        )
    )
}
export default Posts;
